import React, {useEffect, useState} from 'react';
import './App.scss';
import {UserApi} from "./api/user.api";

function App() {
    const [users, setUsers] = useState([])

    useEffect(() => {
        async function fetchAll() {
            const resp = await UserApi.getAll();
            setUsers(resp);
        }
    }, []);


    return (
        <div className="App">

        </div>
    );
}

export default App;
